import React, { useState } from "react";

const App = () => {
  const green = "#8e44ad";
  const [bg, setBg] = useState(green);
  const bgChange = ()=>{
    let newBg = "#34485e";
    setBg(newBg);
  }

  return (
    <>
      <div>
        <button onClick = {bgChange}> click me</button>
      </div>
    </>
  );
};
export default App;
